import React from "react";
import "./sidebar.css";

function Sidebar() {
  return (
    <div className="sidebar-wrapper">
      <div className="logo-wrapper"></div>
      <div className="menu-wrapper"></div>
      .resume
    </div>
  );
}

export default Sidebar;
